	add("palaeobiology", "{\"term\":\"palaeobiology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|palaeo|biology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The scientific study of prehistoric life, especially of those aspects pertaining to living systems\", \"priority\":1}]}, \"synonyms\":{}}");

