	add("palaver", "{\"term\":\"palaver\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Portuguese\"], \"text\":\"Originally nautical slang, from Portuguese \u0027palavra\u0027 (lang\u003dpt) from \u0027parabola\u0027 (lang\u003dla) The term\u0027s use (especially in Africa) mimics the evolution of the word moot. As such, for sense development, see moot.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A village council meeting, a folkmoo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Talk, especially unnecessary talk, fuss\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1886\u0027\u0027, w:Henry Henry James, \u0027The Princess Casamassima\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"These remarks were received with a differing demonstration: some of the company declaring that if the Dutchman cared to come round and smoke a pipe they would be glad to see him—perhaps he\u0027d show where the thumbscrews had been put on; others being strongly of the opinion that they didn\u0027t want any more advice—they had already had advice enough to turn a donkey\u0027s stomach. What they wanted was to put forth their might without any more \u0027\u0027palaver\u0027\u0027; to do something, or for some one; to go out somewhere and smash something, on the spot—why not?—that very night\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1899\u0027\u0027, w:Stephen Stephen Crane, \u0027Active Service\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Knowing full well the right time and the wrong time for a \u0027\u0027palaver\u0027\u0027 of regret and disavowal, this battalion struggled in the desperation of despair\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, w:Justin Justin Richards, \u0027Option Lock\u0027, p 229\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Not for the first time, he reflected that it was not so much the speeches that strained the nerves as the \u0027\u0027palaver\u0027\u0027 that went with them\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A meeting at which there is much talk; a debate, a moot\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Carlyl\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"This epoch of parliaments and eloquent \u0027\u0027palavers\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Disagreemen\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"I have no \u0027\u0027palaver\u0027\u0027 with him\", \"priority\":13}]}, \"synonyms\":{}}");

