	add("paleography", "{\"term\":\"paleography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|paleo|graphy|lang\u003den}}; imitating Latin \u0027palaeographia\u0027 for the first sense and French \u0027paléographie\u0027 and \u0027paléogéographie\u0027 for the second and third senses.\u0026lt;!-- Note: this term is not derived from the languages noted herein. --\u0026gt;\u0026lt;ref name\u003d\u0026quot;OED\u0026quot;\u0026gt;“[http://dictionary.oed.com/cgi/entry/50169496?single\u003d1\u0026amp;query_type\u003dword\u0026amp;queryword\u003dpalaeography\u0026amp;first\u003d1\u0026amp;max_to_show\u003d10 palaeography {{!}} paleography, \u0027n.\u0027]” listed in the \u0027Oxford English Dictionary\u0027, second edition, draft revision (March 2005)\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lt;!-- The order of these definitions is mentioned in the etymology; please do not re-order the senses without changing the etymology to match. --\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The study of old or ancient forms of writing.\u0026lt;ref name\u003doed/\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ancient scripts or forms of writing themselves, as uncial, \u0027scriptio continua\u0027, or methods of using papyrus scrolls\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Paleogeography\", \"priority\":4}]}, \"synonyms\":{}}");

	add("paleoillustrator", "{\"term\":\"paleoillustrator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|paleo|illustrator|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An artist who produces scientific illustrations of prehistoric flora and fauna\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027The Guild Handbook of Scientific Illustration\u0027 (Elaine R. S. Hodges), John Wiley \u0026amp; Sons (2003), ISBN 9780471360117, [https://books.google.com/books?id\u003dgD8pWkA6TcwC\u0026amp;pg\u003dPA330\u0026amp;dq\u003d%22paleoillustrator%22 page 330\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Typically, the artist is asked to document the smallest details of a fossil bone. The \u0027\u0027paleoillustrator\u0027\u0027 should not hesitate to point out where additional preparation can be used to locate and define such important characters as sutures and foramina\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Brendan Hanrahan, \u0027Great Day Trips in the Connecticut Valley of the Dinosaurs\u0027, Perry Heights Press (2004), ISBN 9780963018113, [https://books.google.com/books?id\u003dkJDoST4G0sMC\u0026amp;pg\u003dPT9\u0026amp;dq\u003d%22paleoillustrator%22 page 18\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Since most of what remains of dinosaurs is bones and footprints, a \u0027\u0027paleoillustrator\u0027\u0027 must have a head for paleontology and anatomy as well\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Mark A, Norell, book review, \u0027The Quarterly Review of Biology\u0027, Volume 84, Number 3, September 2009 [http://emdbolker.wdfiles.com/local--files/start/Aiello-Lammens_review_2009.pdf page 288\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Instead of the norm, which is to cop illustrations from other sources, this volume is full of commissioned drawings by John Sibbick—one of the best \u0027\u0027paleoillustrators\u0027\u0027 in the world\", \"priority\":7}]}, \"synonyms\":{}}");

	add("paleolatitude", "{\"term\":\"paleolatitude\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|paleo|latitude|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The former latitude of a particular geologic formation at a time in the geologic past, often specifically the time of formation\", \"priority\":1}]}, \"synonyms\":{}}");

