	add("palingenesis", "{\"term\":\"palingenesis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the Ancient greek (to 1453) \u0027πάλιν\u0027 (again) {suffix||genesis|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The apparent repetition, during the development of a single embryo, of changes that occurred previously in the evolution of its species\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Spiritual rebirth through the transmigration of the soul in Christian baptism\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Rebirth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Regeneration\", \"priority\":4}]}, \"synonyms\":{}}");

	add("palinism", "{\"term\":\"palinism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Palin|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The political philosophy associated with U.S. public figure w:Sarah Sarah Palin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, w:Frank Frank Rich, \u0026quot;[http://www.nytimes.com/2009/07/12/opinion/12rich.html She Broke the G.O.P. and Now She Owns It],\u0026quot; \u0027New York Times\u0027, 11 July (retrieved 20 Aug. 2010\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The essence of \u0027\u0027Palinism\u0027\u0027 is emotional, not ideological\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, David Schultz, \u0026quot;[http://www.opednews.com/articles/What-is-Orthodox-Republica-by-David-Schultz-100728-986.html What is Orthodox Republicanism?],\u0026quot; \u0027OpEdNews.com\u0027, 29 July (retrieved 20 Aug. 2010\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Palinism\u0027\u0027 still seeks to balance the social conservatism and economic liberty of Reaganism, but it takes seriously the Goldwater extremism speech in its hyperactive purism and refusal to compromise\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A statement or turn of phrase made by U.S. public figure Sarah Palin that is unintentionally comical due to malapropisms, dubious coherency, etc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, \u0026quot;[http://www.dnaindia.com/opinion/grafitti_thus-spake-sarah-palin_1206213 Thus spake Sarah Palin],\u0026quot; \u0027Daily News and Analysis\u0027 (India), 13 Nov. (retrieved 20 Aug. 2010\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Sarah Palin has stepped in with her peculiar style of speaking. There are literally thousands of sites catering to the insatiable appetite for \u0027\u0027Palinisms\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Byrony Gordon, \u0026quot;[http://www.telegraph.co.uk/culture/culture-review-of-the-year/3901396/2008-in-celebrity-train-wrecks.html 2008 in celebrity train wrecks],\u0026quot; \u0027telegraph.co.uk\u0027, 22 Dec. (retrieved 20 Aug. 2010\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An entire book could be dedicated to \u0027\u0027Palinisms\u0027\u0027—the gaffes made by the Republican vice-presidential candidate\", \"priority\":10}]}, \"synonyms\":{}}");

	add("palinista", "{\"term\":\"palinista\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Palin|ista|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A devoted admirer of U. S. public figure w:Sarah Sarah Palin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Dimitri Vassilaros, \u0026quot;[http://www.pittsburghlive.com/x/pittsburghtrib/opinion/columnists/vassilaros/s_518318.html The Palin effect],\u0026quot; \u0027Pittsburgh Tribune-Review\u0027, 23 July (retrieved 10 Jan 2010\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ardent \u0027\u0027Palinistas\u0027\u0027 stretch from Alaska to Ambridge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Dan Fagan, \u0026quot;[http://www.adn.com/opinion/comment/fagan/story/463268.html Palin\u0027s statements belie promise of truthful leadership],\u0026quot; \u0027Anchorage Daily News\u0027, 13 July (retrieved 10 Jan 2010\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Palinista\u0027\u0027 movement will boldly tell you over and over how truthful, transparent, open and honest they are\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, w:Evan Evan Thomas, \u0026quot;[http://www.newsweek.com/id/222786 Gone Rogue],\u0026quot; \u0027Newsweek\u0027, 14 Nov. (retrieved 10 Jan 2010\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If the \u0027\u0027Palinistas\u0027\u0027 seize the GOP, they probably cannot take the White House\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Mitch Potter, \u0026quot;[http://www.thestar.com/news/world/article/748719--tea-party-rattles-america-s-educated-class Tea Party rattles America\u0027s educated class],\u0026quot; \u0027Toronto Star\u0027, 10 Jan. (retrieved 10 Jan 2010\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"quot;I\u0027d like to be a \u0027\u0027Palinista\u0027\u0027 but I want a president with a thoughtful world view – that is just a bare minimum requirement,\u0026quot; Reynolds told the Star\", \"priority\":9}]}, \"synonyms\":{}}");

	add("palladoarsenide", "{\"term\":\"palladoarsenide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pallado|arsenide|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monoclinic-prismatic steel gray mineral containing arsenic and palladium\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pallbearer", "{\"term\":\"pallbearer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027pall\u0027 () + \u0027bearer\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who carries a corner of the pall over a coffin or casket\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One called upon to carry or bear the casket at a funeral\", \"priority\":2}]}, \"synonyms\":{}}");

	add("palliard", "{\"term\":\"palliard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Old French \u0027paillard\u0027, from \u0027paille\u0027 ‘straw’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a beggar or vagrant, especially a professional on\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027: They all knew him. A \u0027\u0027palliard\u0027\u0027, some said on Henley Street, a wild rogue. — Anthony Burgess, \u0027Nothing Like the Sun\", \"priority\":2}]}, \"synonyms\":{}}");

	add("palliasse", "{\"term\":\"palliasse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thin mattress or under bed stuffed with straw\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027, w:Arthur Conan Sir Arthur Conan Doyle, \u0027The Stark Munro Letters\u0027, ch. 12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Out I sallied and spent sixteen shillings of it upon a new \u0027\u0027palliasse\u0027\u0027 which should go under the straw mattress upon my bed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027 — w:Tom Tom Stoppard. w:Undiscovered Undiscovered Country\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"First Hiker.\u0027 Not even a straw mattress to cling to? \u0026lt;br /\u0026gt; \u0027Rosenstock.\u0027 Not even a \u0027\u0027palliasse\", \"priority\":5}]}, \"synonyms\":{}}");

	add("palliation", "{\"term\":\"palliation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Old (and modern) French, from late Latin \u0027palliare\u0027 ‘cover’, from \u0027pallium\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The alleviation of a disease\u0027s symptoms without a cure; temporary relief\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1521052W A Cuckoo in the passage\u003dThe most rapid and most seductive transition in all human nature is that which attends the \u0027\u0027palliation\u0027\u0027 of a ravenous appetite. There is something humiliating about it\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Una nox dormienda\u0027 means that one final night that has to be slept through after a few score years of pain and its \u0027\u0027palliations\u0027\u0027, of pleasure and disgust after pleasure\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pallidness", "{\"term\":\"pallidness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|pallid|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The characteristic of being pallid\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pallium", "{\"term\":\"pallium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027pallium|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woollen vestment conferred on archbishops by the Pope\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 339\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Gregory sent Augustine a special liturgical stole, the \u0027\u0027\u0027pallium\u0027\u0027\u0027, a piece of official ecclesiastical dress borrowed from the garments worn by imperial officials\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A large cloak worn by Greek philosophers and teachers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The mantle of a mollusc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A sheet of cloud covering the whole sky, especially nimbostratus\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The cerebral cortex\", \"priority\":7}]}, \"synonyms\":{}}");

	add("pallor", "{\"term\":\"pallor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027palor\u0027 (paleness, pallor) from Latin \u0027pallor\u0027 from \u0027palleō\u0027 (i am or look pale, blanch)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Paleness; want of color; pallidity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"pallor\u0027\u0027 of the complexion\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Sir,\u0026quot; said the butler, turning to a sort of mottled \u0027\u0027pallor\u0027\u0027, \u0026quot;that thing was not my master, and there\u0027s the truth. My master\u0026quot;--here he looked round him and began to whisper--\u0026quot;is a tall, fine build of a man, and this was more of a dwarf.\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

