	add("palmetto", "{\"term\":\"palmetto\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any member of either of two closely related genera of New World palms, of the family Arecaceae\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"or its sole species , the saw palmetto, which has medicinal uses\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"represented by about 15 species, some known commonly as \u0027\u0027palmettos\u0027\u0027, others as fan palms\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A native or resident of the US state of South Carolina\", \"priority\":4}]}, \"synonyms\":{}}");

