	add("palmspan", "{\"term\":\"palmspan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|palm|alt1\u003dpalm’s|span|t1\u003d[of] the inner surface of the hand between the wrist and the fingers|t2\u003dthe distance between two ends of a thing, {{n-g|especially}} between those ends furthest apart from each other|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A measure of length equivalent to the breadth of the palm of an average human hand\", \"priority\":1}]}, \"synonyms\":{}}");

